import { Route, Switch } from 'react-router-dom';
import SlidBar from './Components/Slidbar'
import Home from './pages/Home'
import About from './pages/About'
import GuestState from './Context/guestContext/GuestState'

function App() {
  return (
    <GuestState>
    <div className="flex ">
      {/*Slider Bar */}
      <div className="w-0 sm:w-0 lg:w-20 ">
        <div className="flex-shrink-0 h-screen overflow-hidden bg-slidbarcolor p-3  ">
          <SlidBar/>
        </div>
      </div>

      {/*Route all of pages*/}
      <div className="w-full ">
        <div className="h-screen overflow-y-auto bg-pagescolor ">
          <Switch>
            <Route exact path='/' component={Home} />
            <Route exact path='/about' component={About} />
          </Switch>
        </div>
      </div>
    </div>
    </GuestState>
  );
}

export default App;
